import { useState } from 'react';
export default function Showresult04() {
    const [showResultContent, setShowResultContent] = useState(false);
  return (
    <>
      <select >
        <option>Select Department</option>
        <option>CSE</option>
        <option>ECE</option>
        <option>CI</option>
      </select>
      <br></br> <br></br>
      <button onClick={handleClick01}>Next</button><br></br>
    </>
  )
}
